import styled from 'styled-components';

const Button = styled.button`
  color: #666;
  padding: 0;
  margin: 20px;
  width: 220px;
  height: 47px;
  border: 0.5 solid #666;
  border-radius: 50px;
  font-size: 16px;
`;

export default Button;
